import React from "react";

function Register() {
  return (
    <div className="register-container">
      <div className="reg-head">
        <input type="email" name="email" id="" placeholder="E-Mail ID..." />
        <input
          type="password"
          name="password"
          id=""
          placeholder="Password..."
        />
        <input
          type="password"
          name="confirmpass"
          id=""
          placeholder="Comfirm Password..."
        />
      </div>
    </div>
  );
}

export default Register;
